import React, { Fragment } from "react";

const Navbar = () => {
  return (
    <Fragment>
      <nav>
        <div className="nav-wrapper teal lighten-1">
          <a href="#!" className="brand-logo center">
            #List
          </a>
        </div>
      </nav>
    </Fragment>
  );
};

export default Navbar;
